import React from 'react';
import SportPageTemplate from './SportPageTemplate';

const PollsPage = () => {
  return (
    <SportPageTemplate>
      <div style={{ padding: '20px', textAlign: 'center' }}>
        <h2 style={{ fontSize: '24px', marginBottom: '20px' }}>Polls</h2>
        <p style={{ color: '#aaa' }}>Polls coming soon!</p>
      </div>
    </SportPageTemplate>
  );
};

export default PollsPage;
